    content: 
      "\u003cdiv dir=\"ltr\" style=\"line-height: 1.38; margin-bottom: 0pt; margin-top: 0pt;\"\u003e\n\u003ca href=\"https://blogger.googleblog.com/2015/09/https-support-coming-to-blogspot.html\" style=\"text-decoration: none;\"\u003e\u003cspan style=\"background-color: transparent; color: #1155cc; font-family: &quot;arial&quot;; font-size: 14.666666666666666px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\"\u003eBack in September\u003c/span\u003e\u003c/a\u003e\u003cspan style=\"background-color: transparent; color: black; font-family: &quot;arial&quot;; font-size: 14.666666666666666px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"\u003e, we announced that HTTPS support was coming to blogspot.com, making it possible for you to encrypt connections to your blog; since then, many of you have enabled HTTPS for your blogs. In some cases, not all of your blog’s functionality has worked over HTTPS due to \u003c/span\u003e\u003ca href=\"https://developers.google.com/web/fundamentals/security/prevent-mixed-content/?hl=en\" style=\"text-decoration: none;\"\u003e\u003cspan style=\"background-color: transparent; color: #1155cc; font-family: &quot;arial&quot;; font-size: 14.666666666666666px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\"\u003emixed content errors\u003c/span\u003e\u003c/a\u003e\u003cspan style=\"background-color: transparent; color: black; font-family: &quot;arial&quot;; font-size: 14.666666666666666px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"\u003e often stemming from your template, gadgets, or blog post content.\u003c/span\u003e\u003c/div\u003e\n\u003cb id=\"docs-internal-guid-e471a526-2f8f-ff7f-d64f-32543cd465dc\" style=\"font-weight: normal;\"\u003e\u003cbr /\u003e\u003c/b\u003e\n\u003cbr /\u003e\n\u003cdiv dir=\"ltr\" style=\"line-height: 1.38; margin-bottom: 0pt; margin-top: 0pt;\"\u003e\n\u003cspan style=\"background-color: transparent; color: black; font-family: &quot;arial&quot;; font-size: 14.666666666666666px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"\u003eTo help \u003c/span\u003e\u003ca href=\"https://support.google.com/blogger/answer/6286127?p=mixed_content&amp;rd=1\" style=\"text-decoration: none;\"\u003e\u003cspan style=\"background-color: transparent; color: #1155cc; font-family: &quot;arial&quot;; font-size: 14.666666666666666px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\"\u003espot and fix\u003c/span\u003e\u003c/a\u003e\u003cspan style=\"background-color: transparent; color: black; font-family: &quot;arial&quot;; font-size: 14.666666666666666px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"\u003e some of these errors, we're releasing a mixed content warning tool that alerts you to possible mixed content issues in your posts, and gives you the option to fix them automatically before saving.\u003c/span\u003e\u003c/div\u003e\n\u003cb style=\"font-weight: normal;\"\u003e\u003cbr /\u003e\u003c/b\u003e\n\u003cbr /\u003e\n\u003cdiv class=\"separator\" style=\"clear: both; text-align: center;\"\u003e\n\u003ca href=\"https://2.bp.blogspot.com/-4kHUXAE30PQ/VxZq0KX3-HI/AAAAAAAASOE/EHPNBradnAMfpi5IWSOpAzndawkKphFDACLcB/s1600/mixed-content-warning-screenshot.png\" imageanchor=\"1\" style=\"margin-left: 1em; margin-right: 1em;\"\u003e\u003cimg border=\"0\" height=\"212\" src=\"https://2.bp.blogspot.com/-4kHUXAE30PQ/VxZq0KX3-HI/AAAAAAAASOE/EHPNBradnAMfpi5IWSOpAzndawkKphFDACLcB/s640/mixed-content-warning-screenshot.png\" width=\"640\" /\u003e\u003c/a\u003e\u003c/div\u003e\n\u003cdiv dir=\"ltr\" style=\"line-height: 1.38; margin-bottom: 0pt; margin-top: 0pt;\"\u003e\n\u003cbr /\u003e\u003c/div\u003e\n\u003cb style=\"font-weight: normal;\"\u003e\u003cbr /\u003e\u003c/b\u003e\n\u003cbr /\u003e\n\u003cdiv dir=\"ltr\" style=\"line-height: 1.38; margin-bottom: 0pt; margin-top: 0pt;\"\u003e\n\u003cspan style=\"background-color: transparent; color: black; font-family: &quot;arial&quot;; font-size: 14.666666666666666px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"\u003eTo use the tool, \u003c/span\u003e\u003ca href=\"https://support.google.com/blogger/answer/6284029?hl=en\" style=\"text-decoration: none;\"\u003e\u003cspan style=\"background-color: transparent; color: #1155cc; font-family: &quot;arial&quot;; font-size: 14.666666666666666px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\"\u003eturn on HTTPS for your blog\u003c/span\u003e\u003c/a\u003e\u003cspan style=\"background-color: transparent; color: black; font-family: &quot;arial&quot;; font-size: 14.666666666666666px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"\u003e, open the Blogger editor HTML view, and click Save or Publish. If the editor detects any errors they will be shown above the editor, along with the option to fix the errors found.\u003c/span\u003e\u003c/div\u003e\n\u003cb style=\"font-weight: normal;\"\u003e\u003cbr /\u003e\u003c/b\u003e\n\u003cbr /\u003e\n\u003cdiv dir=\"ltr\" style=\"line-height: 1.38; margin-bottom: 0pt; margin-top: 0pt;\"\u003e\n\u003cspan style=\"background-color: transparent; color: black; font-family: &quot;arial&quot;; font-size: 14.666666666666666px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"\u003eHappy blogging!\u003c/span\u003e\u003c/div\u003e\n\u003cbr /\u003e\n\u003cspan style=\"font-family: &quot;arial&quot;; font-size: 14.6667px; vertical-align: baseline; white-space: pre-wrap;\"\u003ePosted by Shweta Karwa, Software Engineer, Security. \u003c/span\u003e",
